import React, { useState } from "react";

import { Modal, Button } from "react-bootstrap";
import AccountChangeModal from "../components/AccountChangeModal";

const UserAccount = () => {
  const [showAccountModal, setshowAccountModal] = useState(false);
  const [showAccountChangeModal, setshowAccountChangeModal] = useState(false);
  return (
    <div>
      <div className="row mb-none-30">
        <div className="col-md-12">
          <div className="blog-item  mb-30">
            <div className="content" style={{ display: "flex" }}>
              <div className="col-md-6">
                <p className="profilelabel">
                  Member Since <span style={{ margin: "10px" }}>:</span>
                  <span className="profiledata">21/07/20</span>
                </p>
                <p className="profilelabel">
                  Account Type <span style={{ margin: "10px" }}>:</span>{" "}
                  <span className="profiledata">Basic</span>
                </p>
              </div>

              <div className="col-md-6">
                <p className="profilelabel">
                  Member ID
                  <span style={{ margin: "10px" }}>:</span>{" "}
                  <span className="profiledata">SS20AA34</span>
                </p>
                <p className="profilelabel">
                  Subscription till<span style={{ margin: "10px" }}>:</span>{" "}
                  <span className="profiledata">July 2021</span>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>

      <div className="row mb-none-30">
        <div className="col-md-12 ">
          <div className="blog-item mb-30" style={{ marginTop: "2%" }}>
            <div className="content promoBg"></div>
          </div>
        </div>
      </div>
      {/* blog-item end */}
    </div>
  );
};

export default UserAccount;
